// src/pages/doador/DoadorList.jsx

import React, { useEffect, useState } from "react";

function DoadorList() {
  const [doadores, setDoadores] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/doadores")
      .then((res) => res.json())
      .then((data) => setDoadores(data))
      .catch((err) => console.error("Erro ao listar doadores:", err));
  }, []);

  return (
    <div>
      <h2>Lista de Doadores</h2>
      <table>
        <thead>
          <tr>
            <th>CPF</th>
            <th>Nome</th>
            <th>Idade</th>
            <th>Sexo</th>
            <th>Tipo Sangu√≠neo</th>
            <th>Cidade</th>
            <th>CEP</th>
          </tr>
        </thead>
        <tbody>
          {doadores.map((doador) => (
            <tr key={doador.pessoa.cpf}>
              <td>{doador.pessoa.cpf}</td>
              <td>{doador.pessoa.nome}</td>
              <td>{doador.pessoa.idade}</td>
              <td>{doador.sexo}</td>
              <td>{doador.pessoa.tipoSanguineo}</td>
              <td>{doador.pessoa.enderecoCidade}</td>
              <td>{doador.pessoa.enderecoCep}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default DoadorList;
